import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';

import { Button, ButtonNavigation, Gap, ListSupplier } from '../../Component';
import {
  styContainer,
  styContainerBottom,
  styTitle,
  styContainerTop,
} from './styles';

const Home = () => {
  const [page, setPage] = useState(1);
  const [size, setSize] = useState(10);
  const [data, setData] = useState([]);
  const [totalPages, setTotalPages] = useState(0);
  const navigate = useNavigate();

  useEffect(() => {
    setData([]);
    axios
      .get(
        `https://mobile.dev.quadrant-si.id/developertest/supplier/inquiry/${page}/${size}`
      )
      .then((res) => {
        setData(res.data.data);
        setTotalPages(res.data.totalPages);
        console.log(res.data);
      });
  }, [page, size]);

  return (
    <div className={styContainer}>
      <div className={styContainerTop}>
        <h1 className={styTitle}>Supplier</h1>
        {data.map((e, i) => (
          <div key={i}>
            <ListSupplier data={e} />
            <Gap height={10} />
          </div>
        ))}
      </div>
      <div>
        <div className={styContainerBottom}>
          <div>Total Pages : {totalPages}</div>
          <Button
            type="btn-plus"
            onClick={(e) => {
              console.log('test');
              navigate(`/supplier/add`);
            }}
          />
        </div>
        <ButtonNavigation />
      </div>
    </div>
  );
};

export default Home;
